sys_variable_value.value:
(function execute(inputs, outputs) {

  var rf = new x_58056_rf.RequestFulfillment();
  // Convert to an array
  var parallelTasks = inputs.activityIDs.split(",");
  var taskDetails = rf.getTaskDetails(inputs.reqItemGR, parallelTasks);
  outputs.taskIDs = rf.createTasks(inputs.reqItemGR, taskDetails);

})(inputs, outputs);

